-- ----------------------------
-- Table structure for sys_prop
-- ----------------------------
DROP TABLE IF EXISTS `sys_prop`;
CREATE TABLE `sys_prop`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `version` int(38) NOT NULL COMMENT '版本',
  `app_id` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'APP_ID',
  `prop_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '参数名称',
  `prop_desc` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '参数说明',
  `prop_value` varchar(254) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '参数值',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 290809 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '公共参数表' ROW_FORMAT = Compact;

